import React from "react";
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import pdfMake from 'pdfmake/build/pdfmake';
import vfsFonts from 'pdfmake/build/vfs_fonts';

class Form extends React.Component{

    getCertificate= ()=>{
        const {vfs} = vfsFonts.pdfMake;
        pdfMake.vfs = vfs;

        const name = document.getElementById('name').value;
        const title = document.getElementById('title').value;
        var today = new Date();
        var dd = today.getDate();
        var mm = today.getMonth() + 1;
        var yyyy = today.getFullYear();
        if (dd < 10) {
            dd = '0' + dd
        }
        if (mm < 10) {
            mm = '0' + mm
        }
        const date = mm + '/' + dd + '/' + yyyy;

        const docDefinition = {
            // Set page size
            pageSize: 'A4',
            // Set document orientation
            pageOrientation: 'landscape',
            // Set page margins
            pageMargins: [0, 0, 0, 0],

            // Define main body of document
            content: [
                // Include logo image (image is encoded as base64 string)
                {
                    image: 'data:image/png;base64,',
                    alignment: 'center',
                    margin: [0, 30, 0, 30]
                },
                // Include certificate text
                {
                    text: 'Software Professionals Inc.',
                    fontSize: 30,
                    alignment: 'center',
                    margin: [0, 0, 0, 30]
                },
                // Include certificate text
                {
                    text: 'This is to certify that',
                    fontSize: 16,
                    alignment: 'center',
                    margin: [0, 0, 0, 30]
                },
                // Include learner name
                {
                    text: name,
                    fontSize: 25,
                    alignment: 'center',
                    margin: [0, 0, 0, 30]
                },
                // Include certificate text
                {
                    text: 'successfully completed the following activity',
                    fontSize: 16,
                    alignment: 'center',
                    margin: [0, 0, 0, 30]
                },
                // Include project title
                {
                    text: title,
                    fontSize: 25,
                    alignment: 'center',
                    margin: [0, 0, 0, 120]
                },
                // Include date
                {
                    text: 'Awarded on: ' + date,
                    fontSize: 16,
                    alignment: 'center',
                    margin: [0, 0, 0, 0]
                },
            ]
        };
        pdfMake.createPdf(docDefinition).download('CourseCertificate.pdf');

    }

    render(){
        return(
            <div>
                <form >
                    <TextField
                        id="name"
                        label="Name"
                        margin="normal"
                    /><br/>

                    <TextField
                        id="title"
                        label="Training Module"
                        margin="normal"
                    /><br/>
                    <Button color="primary" onClick={this.getCertificate} >
                        Get Certificate
                    </Button>
                </form>
            </div>
        )

    }
}
export default Form;